import React from 'react'
import { Grid, Pagination } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/grid';
import 'swiper/css/pagination';import { Swiper, SwiperSlide } from 'swiper/react';


const Newpro = () => {
  return (
    <section >
      <Swiper
        slidesPerView={3}
        grid={{
          rows: 2,
        }}
        spaceBetween={10}
        pagination={{
          clickable: true,
        }}
        modules={[Grid, Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src='https://wallpaperaccess.com/full/267434.jpg' alt='ads' className='rounded-lg object-cover justify-center'/>
          <h3>Product Title : hello</h3>
          <p>Rs. 100</p>
        </SwiperSlide>
        <SwiperSlide>
          <img src='https://wallpaperaccess.com/full/267434.jpg' alt='ads' className='rounded-lg object-cover justify-center'/>
          <h3>Product Title : hello</h3>
          <p>Rs. 100</p>
        </SwiperSlide>
        <SwiperSlide>
          <img src='https://wallpaperaccess.com/full/267434.jpg' alt='ads' className='rounded-lg object-cover justify-center'/>
          <h3>Product Title : hello</h3>
          <p>Rs. 100</p>
        </SwiperSlide>
        <SwiperSlide>
          <img src='https://wallpaperaccess.com/full/267434.jpg' alt='ads' className='rounded-lg object-cover justify-center'/>
          <h3>Product Title : hello</h3>
          <p>Rs. 100</p>
        </SwiperSlide>
      </Swiper>
    </section>
  )
}

export default Newpro

const ProductUnit = ({ imageUrl, price, productTile, id }) => {
  <div className="w-full">
    <img
      src={imageUrl}
      alt={`product_unit_${id}`}
      className="w-full object-contain "
    />
    <h3>{productTile}</h3>
    <p>Rs.{price}</p>
  </div>;
};
